I’m here in Vietnam as a culinary arts envoy on behalf of the US Embassy Vietnam and, as a Vietnamese-American, am proud to represent both cultures at the intersection of my identity 🇻🇳🇺🇸

On my first day of the tour, we went to Van Ho Agritage in Son La where I showed the Thai ethnic minority women how to make Korean charcoal-grilled pork belly, kim chi fried sticky rice, and cheese corn using some of their native ingredients 🐖🍚🌽 In turn, as part of this culinary exchange program, the women made us grilled fish and colorful sticky rice 🐟
@suhpremeleader and I got to taste wild forest peppercorns for the first time, which are hand-picked from ash trees before they are roasted over fire. They remind me of Sichuan peppercorns but not as numbing with a hint of citrus. They smell and taste so great! Hope to incorporate them into a future dish at the restaurants.

@theblindcook and @mstanyaholland give advice to their younger selves at the 5 year Anniversary screening of @afinelinemovie last week in Napa, CA’s @ciaatcopia.

A full blog recap will be posted on mappimpact.org this week 10/27

